# We want to check if removing some makes it work.
# We know removing 104 and 119 makes it consistent (graph analysis said 5 edges involving 104 and 119).
# Actually, 14, 44, 59 form one set, 104, 119 form the other set of the bipartite graph.
# Edges: (14,104), (44,104), (44,119), (59,104), (59,119).
# If we remove {104, 119}, all edges gone. (Removes 2)
# If we remove {14, 44, 59}, all edges gone. (Removes 3)
# So removing 104 and 119 is optimal for count.

# Let's try to generate circuit with 104 and 119 removed.
reduced_stabilizers = [s for i, s in enumerate(stabilizers) if i not in [104, 119]]

try:
    tableau = stim.Tableau.from_stabilizers(
        [stim.PauliString(s) for s in reduced_stabilizers],
        allow_redundant=True,
        allow_underconstrained=True
    )
    circuit = tableau.to_circuit()
    print("Circuit generated with [104, 119] removed.")
    
    with open(r"C:\Users\anpaz\Repos\quantum-ai\rq1\data\gemini-3-pro-preview\agent_files\circuit_135_drop_119.stim", "w") as f:
        f.write(str(circuit))
        
except Exception as e:
    print(f"Failed with removed: {e}")

